import React from 'react';
import { Formik } from 'formik';
import * as Yup from 'yup';

const ValidacaoCadastro = () => (
    

    <Formik
    initialValues={{ email: "", password: ""}}
    onSubmit={(values, {setSubmitting}) => {
        setTimeout(() => {
            console.log("Entrando", values)
        }, 500);
    }}
    
    >

        { props => {
            const {
                values,
                touched,
                erros,
                isSubmitting,
                handleChange,
                handleBlur,
                handleSubmit
            } = props

            return (
                
                <form className="form-control-style" autoComplete="off" onSubmit={handleSubmit}>
                    <div className="form-box">
                    <h1 className="login-text"> Fa√ßa o login na sua conta! </h1>
                    <input
                            name="email"
                            value={values.email}
                            type="email"
                            placeholder="E-mail"
                            className="input-box" />
                    </div>

                </form>
               
            )
        }}
    </Formik>
)

export default ValidacaoCadastro
